import { render } from '@testing-library/react';
import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    let leagueAverages = require('/LeagueAvg.json')

    return (
      <div>
        {leagueAverages.map((leagueAverages) => (
          <p>{leagueAverages.league}</p>
        ))}
      </div>
    )
  }
}

export default App;
